import React, { useState } from "react";
import {
  Container,
  Typography,
  Button,
  Alert,
  Modal,
  TextField,
  Stack,
} from "@mui/material";
import { useAuth0, withAuthenticationRequired } from "@auth0/auth0-react";
import { getConfig } from "../config";
import Loading from "../components/Loading";

const ExternalApiComponent = () => {
  const { apiOrigin = "http://localhost:3001", audience } = getConfig();

  const [state, setState] = useState({
    showResult: false,
    apiMessage: "",
    error: null,
    showReportModal: false,
    showDonateModal: false,
    email: "",
    score: 0,
    reportName: "",
    reportDescription: "",
    reportDate: "",
    reportImage: null,
  });

  const {
    getAccessTokenSilently,
    loginWithPopup,
    getAccessTokenWithPopup,
  } = useAuth0();

  const toggleReportModal = () => {
    setState((prevState) => ({
      ...prevState,
      showReportModal: !prevState.showReportModal,
    }));
  };

  const toggleDonateModal = () => {
    setState((prevState) => ({
      ...prevState,
      showDonateModal: !prevState.showDonateModal,
    }));
  };

  const handleConsent = async () => {
    try {
      await getAccessTokenWithPopup();
      setState({
        ...state,
        error: null,
      });
    } catch (error) {
      setState({
        ...state,
        error: error.error,
      });
    }

    await callApi();
  };

  const handleLoginAgain = async () => {
    try {
      await loginWithPopup();
      setState({
        ...state,
        error: null,
      });
    } catch (error) {
      setState({
        ...state,
        error: error.error,
      });
    }

    await callApi();
  };

  const callApi = async () => {
    try {
      const token = await getAccessTokenSilently();

      const response = await fetch(`${apiOrigin}/api/external`, {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });

      const responseData = await response.json();

      setState({
        ...state,
        showResult: true,
        apiMessage: responseData,
      });
    } catch (error) {
      setState({
        ...state,
        error: error.error,
      });
    }
  };

  const handle = (e, fn) => {
    e.preventDefault();
    fn();
  };

  const handleDonate = async () => {
    // You can fetch the form data and send it to your backend here
    toggleDonateModal();
  };

  const handleReportSubmit = async () => {
    // You can fetch the report form data and send it to your backend here
    toggleReportModal();
  };

  const handleImageChange = (e) => {
    const file = e.target.files[0];
    setState({
      ...state,
      reportImage: file,
    });
  };

  const handleEmailChange = (e) => {
    setState({
      ...state,
      email: e.target.value,
    });
  };

  const handleScoreChange = (e) => {
    setState({
      ...state,
      score: parseInt(e.target.value),
    });
  };

  return (
      <Container maxWidth="md">
        <Typography variant="h4" align="center" gutterBottom>
          Score: 100
        </Typography>
        <Stack direction="row" justifyContent="center" spacing={2}>
          {state.error === "consent_required" && (
              <Alert severity="warning">
                You need to{" "}
                <Button
                    color="primary"
                    onClick={(e) => handle(e, handleConsent)}
                    size="small"
                >
                  Consent
                </Button>{" "}
                to get access to user's API.
              </Alert>
          )}

          {state.error === "login_required" && (
              <Alert severity="warning">
                You need to{" "}
                <Button
                    color="primary"
                    onClick={(e) => handle(e, handleLoginAgain)}
                    size="small"
                >
                  Log In Again
                </Button>{" "}
                to access the API.
              </Alert>
          )}
        </Stack>
        <Stack direction="row" justifyContent="center" spacing={2} mt={3}>
          <Button
              variant="contained"
              color="primary"
              onClick={toggleReportModal}
          >
            Report Activity
          </Button>
          <Button
              variant="contained"
              color="primary"
              onClick={toggleDonateModal}
          >
            Donate Carbon Credit
          </Button>
        </Stack>

        <Modal open={state.showReportModal} onClose={toggleReportModal}>
          <Container maxWidth="sm" sx={{ mt: 4 }}>
            <Typography variant="h5" align="center" gutterBottom>
              Report Activity
            </Typography>
            <form>
              <TextField
                  label="Report Name"
                  fullWidth
                  value={state.reportName}
                  onChange={(e) =>
                      setState({ ...state, reportName: e.target.value })
                  }
                  sx={{ mb: 2 }}
              />
              <TextField
                  label="Report Description"
                  fullWidth
                  multiline
                  rows={4}
                  value={state.reportDescription}
                  onChange={(e) =>
                      setState({ ...state, reportDescription: e.target.value })
                  }
                  sx={{ mb: 2 }}
              />
              <TextField
                  label="Date"
                  type="date"
                  fullWidth
                  value={state.reportDate}
                  onChange={(e) =>
                      setState({ ...state, reportDate: e.target.value })
                  }
                  sx={{ mb: 2 }}
              />
              <input
                  type="file"
                  accept="image/*"
                  onChange={handleImageChange}
                  sx={{ mb: 2 }}
              />
              <Stack direction="row" justifyContent="center">
                <Button
                    variant="contained"
                    color="primary"
                    onClick={handleReportSubmit}
                >
                  Submit
                </Button>{" "}
                <Button variant="contained" onClick={toggleReportModal}>
                  Close
                </Button>
              </Stack>
            </form>
          </Container>
        </Modal>

        <Modal open={state.showDonateModal} onClose={toggleDonateModal}>
          <Container maxWidth="sm" sx={{ mt: 4 }}>
            <Typography variant="h5" align="center" gutterBottom>
              Donate Carbon Credit
            </Typography>
            <form>
              <TextField
                  label="Email"
                  fullWidth
                  type="email"
                  value={state.email}
                  onChange={handleEmailChange}
                  sx={{ mb: 2 }}
              />
              <TextField
                  label="Score"
                  fullWidth
                  type="number"
                  value={state.score}
                  onChange={handleScoreChange}
                  sx={{ mb: 2 }}
              />
              <Stack direction="row" justifyContent="center">
                <Button
                    variant="contained"
                    color="primary"
                    onClick={handleDonate}
                >
                  Submit
                </Button>{" "}
                <Button variant="contained" onClick={toggleDonateModal}>
                  Close
                </Button>
              </Stack>
            </form>
          </Container>
        </Modal>
      </Container>
  );
};

export default withAuthenticationRequired(ExternalApiComponent, {
  onRedirecting: () => <Loading />,
});
